webpackJsonp([0xe76051383ebd],{377:function(e,i){e.exports={data:{markdownRemark:{html:'<h3>Описание:</h3>\n<p>Жим гантелей сидя является базовым упражнением. Акцентирует нагрузку на средние и боковые пучки плеч, также в работе задействованы трицепсы. Упражнение удобней делать сидя, но можно и стоя. Если делаете сидя, то угол наклона спинки на скамье должен быть от 80-90 градусов.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n<li>Сядьте на отрегулированную силовую скамью, удерживая гантели в руках.</li>\n<li>Исходное положение – спина и поясница прижаты к спинке скамьи, поднимите гантели на уровень глаз. Разверните локти в стороны, предплечья вертикальны, ладони смотрят вперед, стопы уперты в пол.</li>\n<li>На выдохе - выжимайте гантели к верхней точке, немного сближая их. Задержитесь в верхней точке на пару секунд.</li>\n<li>На вдохе - вернитесь в исходное положение.</li>\n<li>Повторите жим гантелей необходимое число раз.</li>\n</ol>\n<h3>Видео-инструкция:</h3>\n<iframe width="100%" height="550rem" src="https://www.youtube.com/embed/WRPUqz44UOM" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>',frontmatter:{path:"/exercise/jim-gantelei-sidya",efficiency:"8",title:"Жим гантелей сидя",image:"/1-01-0.png",image_2:"",image_3:"",image_4:"",filterby:"shoulders",date:"April 12, 2017",injury:"5",bodypart:"Плечи",filtertype:"isolated",type:"Изолирующее",filterinventory:"dumbbells",inventory:"Гантели",filterplace:""}}},pathContext:{}}}});
